12	de	<p>Kaffee Organico mild</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Besonders milder Kaffee aus Mexico</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 2 von 5</li>\n\t<li>Würzig feines Mandel-Karamell Aroma mit Nuancen von Sternfrucht</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzent*innenorganisationen</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Das südliche Bergland Mexikos ist Heimat des Kaffee Orgánicos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kaffeegärten werden sorgfältig von indianischen Kleinbäuerinnen und -bauern gepflegt. Ihr Wissen über den biologischen Anbau und ihr erfahrener, achtsamer Umgang mit der Natur lassen Besonderes reifen: Feuerrote Kirschen - von Hand geerntet, gewaschen, vom Fruchtfleisch befreit, an der Sonne getrocknet, Bohne für Bohne verlesen.</p>	13	<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>
41	de	<p>Schwarztee</p>	<ul class="stwul">\n\t<li>Aromatischer Ceylon-Tee aus Sri Lanka</li>\n\t<li>Mit natürlichem Bergamotte Aroma</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Kontrolliert biologischer Anbau</li>\n\t<li>Nachhaltige Verpackung</li>\n</ul>	<p>Die Wurzeln dieses aromatischen Hochlandtees liegen in der Zentralregion Sri Lankas, in den Teegärten der Small Organic Farmers Association. Die Kleinbäuerinnen und -bauern haben sich für biologischen Landbau entschieden. Das Zusammenspiel von Boden und Klima, die sorgfältige Pflege der Büsche, die behutsame Ernte der Blätter sowie die erfahrene Weiterverarbeitung des frischen Blattguts in der Teefabrik von Bio-Foods garantieren besonderen Teegenuss.</p>	42	<p><strong>Zutaten:</strong><br>\nSchwarztee<br>\nBergamotte Aroma</p>
7	de	<p>Kaffee Organico mild</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Besonders milder Kaffee aus Mexico</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 2 von 5</li>\n\t<li>Würzig feines Mandel-Karamell Aroma mit Nuancen von Sternfrucht</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzent*innenorganisationen</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Das südliche Bergland Mexikos ist Heimat des Kaffee Orgánicos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kaffeegärten werden sorgfältig von indianischen Kleinbäuerinnen und -bauern gepflegt. Ihr Wissen über den biologischen Anbau und ihr erfahrener, achtsamer Umgang mit der Natur lassen Besonderes reifen: Feuerrote Kirschen - von Hand geerntet, gewaschen, vom Fruchtfleisch befreit, an der Sonne getrocknet, Bohne für Bohne verlesen.</p>	8	<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>
11	de	<p>Kaffee Espresso Organico</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Kräftige Französische Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen nach Rohkakao und Bitterschokolade, leicht herb, Nuancen von der Dörrpflaume, langanhaltend im Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzent*innenorganisationen</li>\n\t<li>Geeignet für alle gängigen Kaffeepadmaschinen</li>\n\t<li>Aluminiumfreie Verpackung</li>\n\t<li>Einzelportionen à ca. 7 g</li>\n</ul>	<p>Das südliche Bergland Mexikos ist Heimat des Kaffee Orgánicos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kaffeegärten werden sorgfältig von indianischen Kleinbäuerinnen und -bauern gepflegt. Ihr Wissen über den biologischen Anbau und ihr erfahrener, achtsamer Umgang mit der Natur lassen Besonderes reifen: Feuerrote Kirschen - von Hand geerntet, gewaschen, vom Fruchtfleisch befreit, an der Sonne getrocknet, Bohne für Bohne verlesen.</p>	12	<p><strong>Zutaten:</strong><br>\nKaffee geröstet &amp; gemahlen</p>
65	de	<p>Ersatzmembran - Kaffeekapsel Set</p>	<ul>\n\t<li>Kompatibel mit dem wiederbefüllbaren Kaffeekapsel Set von EZA</li>\n\t<li>Geeignet für grob gemahlene Kaffeesorten (Filterkaffeesorten)</li>\n\t<li>Perfekt für einen Kaffee Lungo oder Verlängerten</li>\n\t<li>Frei von Aluminium</li>\n\t<li>Spülmaschinenfest</li>\n</ul>\n\n<p>Die Membran (Deckel) ist ein Verschleißteil und sollte daher für die Sicherstellung eines reibungslosen Betriebes alle 6 Monate ausgetauscht werden.</p>	<p>Mit dem Kaffeekapsel Set von EZA entlasten Sie enorm die Umwelt da nur der Kaffeesatz zu entsorgen ist. Dazu können Sie Ihren Lieblingskaffee trinken und nebenbei eine Menge Geld sparen.</p>\n\n<p><strong>Für das Kaffeekapsel Set - milde Röstung empfehlen wir:</strong></p>\n\n<ul>\n\t<li>Kaffee Organico Mild</li>\n\t<li>Kaffee Pueblo</li>\n\t<li>Kaffee Nica</li>\n\t<li>Kaffee Mundo</li>\n\t<li>Kaffee Abessa</li>\n\t<li>COFFEE FOR FUTURE</li>\n</ul>	66	
17	de	<p>Kaffee Nica gehaltvoll</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Gehaltvoller Kaffee aus Nicaragua</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 3 von 5</li>\n\t<li>Aromen nach Haselnuss mit Nuancen von Galgant, leichte Fruchtsäure, kräftiger Körper, würzig aber nicht scharf</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der Ursprung des Kaffee Nica liegt in Nicaragua. In den Regionen um Boaco, Matagalpa, Nueva Segovia und Jinotega werden auf rund 750 - 1.400 Meter Seehöhe Kaffeesträucher unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt angebaut. Viele der Familien besitzen erst seit der sandinistischen Revolution eigenes Land. Kaffee stellt meist die einzige Verdienstquelle dar. Zur Selbstversorgung pflanzen sie hauptsächlich Mais, Bohnen und Pfefferschoten, für den lokalen Markt auch Bananen, Zitrusfrüchte, Ingwer und Kakao an. Die Bäuerinnen und Bauern leben in abgelegenen Gegenden, in denen vor allem kleinbäuerliche Landwirtschaft ohne Chemieeinsatz betrieben wird.</p>	18	<p><strong>Zutaten:</strong><br>\nKaffee geröstet &amp; gemahlen</p>
