nen verbessern. Sie bestimmen über die Verwendung der Prämie aus Fairem Handel mit. So werden Vorhaben verwirklicht, die den Familien auf Samabeong direkt zugute kommen.</p>	50	<p><strong>Zutaten:</strong><br>\nHalbfermentierter Tee</p>
