59	de	<p>Magerkakaopulver &amp; Rohrzucker</p>	<ul>\n\t<li>Aromatisch feine lateinamerikanische Mischung aus kontrolliert biologischem Anbau</li>\n\t<li>Mit Magerkakaopulver &amp; Rohrzucker</li>\n\t<li>Nachhaltige Papierverpackung</li>\n</ul>\n\n<p>Zubereitung: Einfach 2 bis 3 gehäufte Teelöffel in einem Glas Milch auflösen, umrühren und genießen. Ideal mit kalter oder warmer Milch sowie in Getreidedrinks, Sojadrinks, Reisdrinks und Mandeldrinks.</p>	<p>Die Süße des Rohrzuckers von unseren Produzenten Manduvirá aus Paraguay verbindet sich in der EZA Equita Trinkschokoladenmischung mit dem feinen Aroma von Kakaobohnen von unseren beiden Produzenten CONACADO und COOPROAGRO aus der Dominikanischen Republik. Die Zutaten stammen von Kleinbäuerinnen und -bauern, die mit viel Erfahrung die hohe Qualität der Zutaten sichern. Dass sie sich für biologischen Anbau entschieden haben, kommt nicht nur der Natur zugute, sondern allen Menschen, die mit dem Produkt zu tun haben: Den Kakaopflanzer*innen ebenso wie den Zuckerrohrbäuerinnen und -bauern bis hin zu den kleinen und großen Genießer*innen des Löskakaos.</p>\n\n<p>Die Mitglieder von COOPROAGRO profitieren durch den Fairen Handel von zahlreichen Vorteilen wie dem Zugang zu technischer Beratung, Unterstützung bei der Qualitätssicherung, Mitbestimmung bei der Verwendung der FAIRTRADE-Prämie und Zugang zu sozialen Projekten und Programmen sowie Kredit- und Sparprogramme und einen Nothilfefonds. Mit den FAIRTRADE-Prämien wurden in der Vergangenheit vor allem Infrastrukturprojekte finanziert – Straßen- und Brückenbauten, die Stromversorgung in einem der Dörfer, eine Schule saniert bzw. ein Vereinshaus gebaut. Auch der Bau eines Krankenhauses konnte mitunterstützt werden. Aktuell will man mit den Prämien vor allem die Verarbeitungsanlagen verbessern und Maßnahmen zur Qualitätssicherung setzen.</p>\n\n<p>Das Zuckerrohr von Manduvirá stammt ausschließlich aus kontrolliert biologischem Anbau und die Bäuerinnen und Bauern leben die Prinzipien der Nachhaltigkeit. Um den Boden vital und fruchtbar zu halten werden Kuh- oder Hühnerdung ausgetragen und stickstoffbindende Pflanzen wie Bohnen gepflanzt. Mindestens 7% der Fläche jedes Mitglieds müssen Schutzgebiete bleiben und dürfen nicht bepflanzt werden. Die Mitglieder der Kooperative können zusätzlich ein breites Angebot an Dienstleistungen in Anspruch nehmen: technische Beratung und Schulungen, günstige Kredite, Sparfonds, Vorauszahlungen und kostengünstige medizinische Versorgung.</p>	60	<p><strong>Zutaten:</strong><br>\nRohrohrzucker<br>\nMagerkakaopulver</p>\n\n<p><strong>Zusatzinfo:</strong><br>\nSpuren von Eiern<br>\nSpuren von Glutenhaltigem Getreide<br>\nSpuren von Lupinen<br>\nSpuren von Milchprodukten<br>\nSpuren von Schalenfrüchte (Nüssen)<br>\nSpuren von Schwefeldioxid und Sulphiten<br>\nSpuren von Sellerie<br>\nSpuren von Sojabohnen</p>\n\n<table border="1" class="bestandteile" style="width: 50%;">\n\t<thead>\n\t\t<tr>\n\t\t\t<th style="text-align: left;">Nährwerte:<br>\n\t\t\tBeschreibung</th>\n\t\t\t<th style="text-align: left;"><br>\n\t\t\tWert</th>\n\t\t</tr>\n\t</thead>\n\t<tbody>\n\t\t<tr>\n\t\t\t<td>K-Joule/100g</td>\n\t\t\t<td>1.590</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>K-Kalorien/100 g</td>\n\t\t\t<td>376</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Fettgehalt g/100g</td>\n\t\t\t<td>2,8</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>davon gesättigte Fettsäuren g/100 g</td>\n\t\t\t<td>1,7</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Kohlenhydrate g/100 g</td>\n\t\t\t<td>78,5</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>davon Zucker g/100 g</td>\n\t\t\t<td>74,8</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Eiweiß g/100g</td>\n\t\t\t<td>5,1</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Salz g/100g</td>\n\t\t\t<td>0,01</td>\n\t\t</tr>\n\t</tbody>\n</table>
61	de	<p>Rohrohzucker</p>	<ul>\n\t<li>Rohrohzucker aus kontrolliert biologischem Anbau</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Nachhaltige Verpackung aus Papier</li>\n\t<li>Aus fairem Handel</li>\n</ul>\n\n<p>Die Weltladen Zuckersticks enthalten jeweils 4g Bio Rohrohrzucker. Das bedeutet, dass der Zucker nur ein einziges Mal raffiniert wird. Die natürliche bräunliche Färbung nimmt dadurch leicht ab, bleibt jedoch erhalten. Die Portionen sind ideal für unterwegs oder praktisch als Beigabe zu Heißgetränken für Ihre Gäste und sehen neben jeder Tasse richtig gut aus.</p>	<p>Das Zuckerrohr von Manduvirá stammt ausschließlich aus kontrolliert biologischem Anbau und die Bäuerinnen und Bauern leben die Prinzipien der Nachhaltigkeit. Um den Boden vital und fruchtbar zu halten werden Kuh- oder Hühnerdung ausgetragen und stickstoffbindende Pflanzen wie Bohnen gepflanzt. Mindestens 7% der Fläche jedes Mitglieds müssen Schutzgebiete bleiben und dürfen nicht bepflanzt werden. Die Mitglieder der Kooperative können zusätzlich ein breites Angebot an Dienstleistungen in Anspruch nehmen: technische Beratung und Schulungen, günstige Kredite, Sparfonds, Vorauszahlungen und kostengünstige medizinische Versorgung.</p>\n\n<p>"Unsere Vision ist es, als Genossenschaft qualitativ hochwertige Dienstleistungen für Kleinerzeuger zu bieten, um ihre Lebensqualität und den Wohlstand der ganzen Gemeinschaft zu verbessern, und die führende Kooperative in der Produktion und Verarbeitung von Bio-Rohrzucker zu sein. Unsere Mission ist die Förderung der ganzheitlichen Entwicklung. Wir bieten eine Reihe von Dienstleistungen und eine ehrliche, transparente und effiziente Verwaltung für das wirtschaftliche und soziale Wohlergehen unserer Mitglieder und der ganzen Gemeindschaft." - Andrés González Aguilera, Geschäftsführer der Manduvirá Cooperative Ltd.</p>	62	<p><strong>Zutaten:</strong><br>\nRohrohrzucker</p>\n\n<table border="1" class="bestandteile" style="width: 50%;">\n\t<tbody>\n\t\t<tr>\n\t\t\t<td><strong>Nährwerte:<br>\n\t\t\tBeschreibung </strong></td>\n\t\t\t<td><strong>Wert</strong></td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>K-Kalorien/100 g</td>\n\t\t\t<td>399</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>K-Joule/100g</td>\n\t\t\t<td>1.695</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Salz g/100g</td>\n\t\t\t<td>0</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Kohlenhydrate g/100 g</td>\n\t\t\t<td>99,7</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>davon Zucker g/100 g</td>\n\t\t\t<td>99,7</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Eiweiß g/100g</td>\n\t\t\t<td>0</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Fettgehalt g/100g</td>\n\t\t\t<td>0</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>davon gesättigte Fettsäuren g/100 g</td>\n\t\t\t<td>0</td>\n\t\t</tr>\n\t</tbody>\n</table>
19	de	<p>Kaffee Nica gehaltvoll</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Gehaltvoller Kaffee aus Nicaragua</li>\n\t<li>Milde feinaromatische Wiener Röstung: Stärke 3 von 5</li>\n\t<li>Aromen nach Haselnuss mit Nuancen von Galgant, leichte Fruchtsäure, kräftiger Körper, würzig aber nicht scharf</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der Ursprung des Kaffee Nica liegt in Nicaragua. In den Regionen um Boaco, Matagalpa, Nueva Segovia und Jinotega werden auf rund 750 - 1.400 Meter Seehöhe Kaffeesträucher unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt angebaut. Viele der Familien besitzen erst seit der sandinistischen Revolution eigenes Land. Kaffee stellt meist die einzige Verdienstquelle dar. Zur Selbstversorgung pflanzen sie hauptsächlich Mais, Bohnen und Pfefferschoten, für den lokalen Markt auch Bananen, Zitrusfrüchte, Ingwer und Kakao an. Die Bäuerinnen und Bauern leben in abgelegenen Gegenden, in denen vor allem kleinbäuerliche Landwirtschaft ohne Chemieeinsatz betrieben wird.</p>	20	<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>
30	de	<p>Geröstet in Italien</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Vollmundige Mischung aus Lateinamerika und Afrika</li>\n\t<li>Kräftige italienische Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen nach Tabak, Bittermandel und Malz, leichte anhaltende Schärfe, langanhaltender Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzent*innenorganisationen</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Aus vier verschiedenen Ländern und zwei unterschiedlichen Kontinenten setzte sich die anspruchsvolle Espresso Italiano Arabica-Mischung zusammen. Verarbeitet wird 100 Prozent Arabica Hochland-Kaffee von höchster Qualität. Die Kaffeebäuerinnen und -bauern des Kaffee Espresso Italiano haben unterschiedliche kulturelle Hintergründe. Indianische Kleinbäuerinnen und -bauern aus Mexiko und Guatemala geben ihre wertvollen Bohnen zusammen mit peruanischen Kaffeebauernfamilien und Angehörige unterschiedlicher Volksgruppen aus Uganda für die Espresso Italiano Mischung. Gemeinsam möchten Sie ihren Kaffee zu fairen Bedingungen vermarkten.</p>	31	<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>
43	de	<p>First Flush</p>	<ul>\n\t<li>Besonders aromatischer Darjeeling-Tee aus kontrolliert biologischem Anbau</li>\n\t<li>Von Hand gepflückt im Samaboeng-Teegarten in Nordindien an den südlichen Ausläufern des Himalaya</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>FTGFOP1 - First Flush</li>\n\t<li>Leicht herb und blumig</li>\n\t<li>Tassenfarbe: Dunkler Bernstein</li>\n\t<li>Verpackung: Handgeschöpftes Papier</li>\n</ul>\n\n<p> </p>\n\n<p>Höchste FTGFOP1 First Flush Qualität: FTG, also Finest Tippy Golden bedeutet, dass der Tee - bis zu 1/4 des Gesamtvolumens - viele feine, helle Spitzen (Tips) enthält. In FOP1 spiegelt sich die Sorgfalt des Pflückens wieder, denn es werden nur die Knospe mit den obersten beiden zarten Blättchen gepflückt, die unteren groben Blätter bleiben am Strauch. Die Zahl Eins wird in Darjeeling für Blätter der höchsten Güteklasse vergeben. Der First Flush beschreibt die erste Pflückungsperiode von Anfang März bis Mitte April. Hierbei werden nur die hellgrünen Blattspitzen geerntet. Dieser Darjeeling besticht daher durch seinen sehr zarten, frisch, blumigen Geschmack. Mit einem FTGFOP1 First Flush-Tee bekommen Sie also einen mit höchster Sorgfalt hergestellten Premiumtee.</p>	<p>Die Wurzeln dieses hocharomatischen, kostbaren Tees liegen an den südlichen Ausläufern des Himalaya im nordindischen Darjeeling. Auf den Plantagen Samabeong, Singell und Selimbong finden die Pflanzen, was sie zum Gedeihen brauchen: Das besondere Klima für Hochlandtee, einen fruchtbaren, biologisch bewirtschafteten Boden und sorgfältige Pflege. Die behutsame Ernte - bei Darjeeling First Flush ist es die erste Pflückung nach dem Winter - sowie die erfahrene Weiterverarbeitung der frischen Blätter in der Teemanufaktur von Tea Promoters India versprechen erlesenen Genuss. Der Faire Handel trägt dazu bei, dass sich die Lebens- und Arbeitsbedingungen der Teepflücker*innen und Teearbeiter*innen verbessern. Sie bestimmen über die Verwendung der Prämie aus Fairem Handel mit. So werden Vorhaben verwirklicht, die den Familien direkt zugute kommen.</p>	44	<p><strong>Zutaten:</strong><br>\nSchwarztee</p>
21	de	<p>Kaffee Jambo Espresso</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Kräftiger Espresso-Kaffee aus Uganda</li>\n\t<li>Kräftige Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen von grünen Tee mit Nuancen von Marzipan, angenehm harmonischer milder Körper, langanhaltend im Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der Ursprung des Kaffee Jambo liegt in der Bugisu Region im Sironko District im Osten Ugandas am Mount Elgon. Der Kaffee wird in dieser Region auf einer Höhe von 2.500 – 3.500 Meter angebaut. Die Kaffeebäuerinnen und -bauern sind Angehörige der Bagisu (aus dem Sironko Distrikt) und Bulambuli und Sabiny (aus dem Kapchorwa District). Hauptprobleme in der Region sind die verbreitete Armut, hohe HIV-Rate und Zerstückelung der Parzellen durch das traditionelle Erbrecht. Neben Kaffee bauen die Kleinbäuerinnen und -bauern auf ihren kleinen Parzellen (durchschnittlich 1 – 2 Hektar) Gemüse für den Eigenbedarf und den lokalen Markt an: Bananen, Yams, Yuca, Süßkartoffel, Mais, Bohnen, Tomaten, Melanzani, etc. Der Honig aus der eigenen Bienenzucht wird vor allem lokal vermarktet. Einige stellen zudem Handwerksprodukte zur Einkommenserzielung her bzw. betreiben Kleinstgewerbe.</p>	22	<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>
46	de	<p>Grüntee</p>	<ul class="stwul">\n\t<li>Aromatischer Ingwer Chai mit wärmender Ingwernote und der Frische von Zitronengras</li>\n\t<li>Grüntee mit 20% Zitronengras und 15% Ingwer aus Sri Lanka</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzent*innenorganisationen</li>\n\t<li>Kontrolliert biologischer Anbau</li>\n\t<li>Nachhaltige Verpackung</li>\n</ul>	<p>Die Wurzeln dieses aromatischen Grüntees mit feinen Anklängen an Ingwer und Zitronengras liegen im Hügelland der Zentralregion Sri Lankas. Hier gedeihen Teesträucher und Gewürze, sorgfältig gepflegt von Kleinbäuerinnen und -bauern, die sich für biologischen Landbau entschieden haben. Vor Ort unterstützt werden sie von Bio Foods, einem Unternehmen, das sich für eine ökologisch und sozial tragfähige Form der Landwirtschaft einsetzt. Bio Foods sorgt für die behutsame Weiterverarbeitung der frischen Blätter in der eigenen Teemanufaktur und sichert mit Erfahrung die hohe Qualität des Tees. Mit EZA Fairer Handel als Partnerin haben die Kleinbauernfamilien die Gewissheit, dass sich ihre wertvolle Arbeit lohnt. Faire Bezahlung und verlässliche Zusammenarbeit eröffnet ihnen und ihren Kindern eine Zukunftsperspektive.</p>	47	<p><strong>Zutaten:</strong><br>\nGrüner Tee<br>\nZitronengras<br>\nIngwer gemahlen</p>
66	de	<p>Ersatzmembran - Kaffeekapsel Set</p>	<ul>\n\t<li>Kompatibel mit dem wiederbefüllbaren Kaffeekapsel Set von EZA</li>\n\t<li>Geeignet für ein gemahlenen Kaffeesorten (Espressokaffeesorten)</li>\n\t<li>Perfekt für einen Kaffee Espresso</li>\n\t<li>Frei von Aluminium</li>\n\t<li>Spülmaschinenfest</li>\n</ul>\n\n<p>Die Membran (Deckel) ist ein Verschleißteil und sollte daher für die Sicherstellung eines reibungslosen Betriebes alle 6 Monate ausgetauscht werden.</p>	<p>Mit dem Kaffeekapsel Set von EZA entlasten Sie enorm die Umwelt da nur der Kaffeesatz zu entsorgen ist. Dazu können Sie Ihren Lieblingskaffee trinken und nebenbei eine Menge Geld sparen.</p>\n\n<p><strong>Für das Kaffeekapsel Set - Espresso empfehlen wir:</strong></p>\n\n<ul>\n\t<li>Kaffee Jambo</li>\n\t<li>Kaffee Adelante</li>\n\t<li>Kaffee Espresso Italiano</li>\n</ul>	67	
24	de	<p>Kaffee Mundo Espresso</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Edle Mischung aus Mittelamerika</li>\n\t<li>Kräftige Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen nach Johannisbeeren, leicht erdig, malzige Noten, leichte Schärfe im Abgang, sehr kräftiger Körper, Geschmack mittellang anhaltend</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzent*innenorganisationen</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Seinen Ursprung hat der Kaffee Mundo Espresso im Bergland Mittelamerikas und Mexikos. Die Kaffeesträucher wachsen auf einer Höhe von rund 1.500 Metern unter Schattenbäumen, in Verbindung mit einer reichhaltigen Pflanzenwelt. Die Kleinbäuerinnen und -bauern des Kaffee Mundo Espresso stammen aus unterschiedlichen Teilen Mittelamerikas und Mexikos. Sie haben unterschiedliche Hintergründe, jedoch auch einige Gemeinsamkeiten. Alle sind in Kooperativen zusammengeschlossen um eine gemeinsame, stärkere Stimme zu haben und mitbestimmen zu können. Außerdem profitieren sie durch den Zusammenschluss von technischen Schulungen und Beratungen sowie einer gemeinschaftlichen Verarbeitung und Vermarktung ihres Kaffees.</p>	25	<p><strong>Zutaten:</strong><br>\nKaffeebohnen geröstet</p>
34	de	<p>Gefriergetrockneter Löskaffee</p>	<ul>\n\t<li>Hergestellt in Lateinamerika</li>\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zu den Produzent*innenorganisationen</li>\n\t<li>Verpackt in einem hochwertigen Kunstoffbehälter</li>\n\t<li>Aromatisches Gefriertrocknungsverfahren</li>\n</ul>	<p>Reine Arabica Hochlandsorten aus Lateinamerika bilden die Basis für Latino Löskaffee. Mit großer Sorgfalt pflegen Kleinbäuerinnen und -bauern die Kaffesträucher und ernten die reifen Kirschen. Ihr Wissen über den biologischen Anbau und ihre Erfahrung im achtsamen Umgang mit der Natur gewährleisten eine hohe Qualität der Bohne. Durch faire Bezahlung und garantierte Prämien können sie auch bei niedrigen Weltmarktpreisen ihre Kosten decken und ihre Lebensbedingungen verbessern. In Europa wird der wertvolle Rohstoff weiterverarbeitet. Das schonende Verfahren der Gefriertrocknung ergibt aromatischen, grobkörnigen Löskaffee. Sein feines Aroma verbindet Genuss mit der Achtung der Menschen, die ihn kultivieren und der Natur, in der er gedeiht. Daraus erwächst Kaffeekultur mit Zukunft.</p>	35	<p><strong>Zutaten:</strong><br>\nGefriergetrockneter Löskaffee</p>
