20	de	<p>Kaffee Jambo Espresso</p>	<ul class="stwul">\n\t<li>100% Arabica Hochlandkaffee aus kontrolliert biologischem Anbau</li>\n\t<li>Kräftiger Espresso-Kaffee aus Uganda</li>\n\t<li>Kräftige Espresso Röstung: Stärke 4 von 5</li>\n\t<li>Aromen von grünen Tee mit Nuancen von Marzipan, angenehm harmonischer milder Körper, langanhaltend im Abgang</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aluminiumfreie Verpackung</li>\n</ul>	<p>Der Ursprung des Kaffee Jambo liegt in der Bugisu Region im Sironko District im Osten Ugandas am Mount Elgon. Der Kaffee wird in dieser Region auf einer Höhe von 2.500 – 3.500 Meter angebaut. Die Kaffeebäuerinnen und -bauern sind Angehörige der Bagisu (aus dem Sironko Distrikt) und Bulambuli und Sabiny (aus dem Kapchorwa District). Hauptprobleme in der Region sind die verbreitete Armut, hohe HIV-Rate und Zerstückelung der Parzellen durch das traditionelle Erbrecht. Neben Kaffee bauen die Kleinbäuerinnen und -bauern auf ihren kleinen Parzellen (durchschnittlich 1 – 2 Hektar) Gemüse für den Eigenbedarf und den lokalen Markt an: Bananen, Yams, Yuca, Süßkartoffel, Mais, Bohnen, Tomaten, Melanzani, etc. Der Honig aus der eigenen Bienenzucht wird vor allem lokal vermarktet. Einige stellen zudem Handwerksprodukte zur Einkommenserzielung her bzw. betreiben Kleinstgewerbe.</p>	21	<p><strong>Zutaten:</strong><br>\nKaffee geröstet &amp; gemahlen</p>
60	de	<p>Vollrohrzucker</p>	<ul>\n\t<li>Naturbelassener Vollrohrzucker aus kontrolliert biologischem Anbau</li>\n\t<li>Unraffiniert und dadurch reich an natürlichen Mineralstoffen</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>Aus fairem Handel</li>\n</ul>	<p>Sein dunkles Braun und sein kräftig aromatischer Geschmack machen Mascobado zum geschätzten Exoten unter den Rohrzuckerarten. Sein Ursprung liegt auf der philippinischen Insel Panay. Dort kultivieren organisierte Kleinbäuerinnen und -bauern mit viel Erfahrung und dem Wissen über den biologischen Anbau ihr Zuckerrohr. In intensiver Handarbeit wird es geerntet und in den kleinen Zuckermühlen vor Ort nach jahrhundertealter Tradition weiter verarbeitet. Mit dem Fairen Handel als Partner haben die Zuckerrohrbäuerinnen und -bauern die Gewissheit, dass sich ihr Aufwand lohnt. Faire Bezahlung und verlässliche Zusammenarbeit gibt ihnen und ihren Kindern eine Zukunft.</p>\n\n<p>Mascobado ist ein nicht raffinierter Vollrohrzucker. Durch das schonende Herstellungsverfahren behält er seine dunkle Farbe, sein volles, karamellartiges Aroma sowie alle wertvollen Mineralstoffe der Pflanze. Der Zuckerrohrsaft wird erhitzt, gefiltert und unter ständigem Rühren abgekühlt bis eine feinkörnige Masse entsteht. Seine Konsistenz ist typisch für das nicht zentrifugierte Naturprodukt. Er eignet sich zum Backen ebenso wie zum manßvollen Süssen von Getränken und Desserts.</p>	61	<p><strong>Zutaten:</strong><br>\nVollrohrzucker</p>\n\n<table border="1" class="bestandteile" style="width: 50%;">\n\t<tbody>\n\t\t<tr>\n\t\t\t<td><strong>Nährwerte:<br>\n\t\t\tBeschreibung </strong></td>\n\t\t\t<td><strong>Wert</strong></td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>K-Kalorien/100 g</td>\n\t\t\t<td>389</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>K-Joule/100g</td>\n\t\t\t<td>1.654</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Salz g/100g</td>\n\t\t\t<td>0,2</td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td>Kohlenhydrate g/100 g</td>\n\t\t\t<t