44	de	<p>Second Flush</p>	<ul>\n\t<li>Würzig, kräftiger Schwarztee aus kontrolliert biologischem Anbau</li>\n\t<li>Von Hand gepflückter Hochlandtee aus der nordindischen Teeregion Assam,von der Banaspaty Plantage</li>\n\t<li>Faire Rohstoffe rückverfolgbar bis zur Produzent*innenorganisation</li>\n\t<li>TGFOP 1 - Second Flush</li>\n\t<li>Herb-Kräftig, leicht malziges Aroma - Idealer Frühstückstee</li>\n\t<li>Tassenfarbe: Tiefrot</li>\n\t<li>Verpackung: Handgeschöpftes Papier</li>\n</ul>\n\n<p> </p>\n\n<p>Höchste TGFOP1 Second Flush Qualität: TG, also Tippy Golden bedeutet, dass der Tee zahlreiche feine, helle Spitzen (Tips) enthält. In FOP1 spiegelt sich die Sorgfalt des Pflückens wieder, denn es werden nur die Knospe mit den obersten beiden zarten Blättchen gepflückt, die unteren groben Blätter bleiben am Strauch. Die Zahl Eins wird in Assam für Blätter der höchsten Güteklasse vergeben. Der Second Flush wird von Ende Mai bis Anfang Juli geerntet. In dieser Zeit zum Höhepunkt der Vegetationsperiode entfaltet er sein hocharomatisches, vollmundiges Aroma. Mit einem TGFOP1 Second Flush-Tee bekommen Sie also einen mit höchster Sorgfalt hergestellten Premiumtee.</p>	<p>Die Wurzeln dieses ergiebigen Schwarztees liegen im nordindischen Assam, einem traditionellen Teeanbaugebiet. Auf der Banaspaty Plantage finden die Pflanzen, was sie zum Gedeihen brauchen: Das besondere Klima für Hochlandtee, einen fruchtbaren, biologisch bewirtschafteten Boden und sorgfältige Pflege. Die behutsame Ernte – bei Assam Second Flush TGFOP 1 sind es die besten Blätter der zweiten Ernte sowie die erfahrene Weiterverarbeitung in der Teemanufaktur von Tea Promoters India auf Banaspaty versprechen aromatischen Genuss. Der Faire Handel garantiert, dass sich die Lebens- und Arbeitsbedingungen der Teepflücker*innen und Teearbeiter*innen verbessern. Es werden Vorhaben verwirklicht, die den Familien auf Banaspaty direkt zugute kommen.</p>	45	<p><strong>Zutaten:</strong><br>\nSchwarztee</p>
